pluginOptions.query:
{
  site {
    siteMetadata {
      title
      description
      siteUrl
      site_url: siteUrl
    }
  }
}

feeds.query:
{
  allMarkdownRemark(
    limit: 1000,
    sort: { order: DESC, fields: [fields___prefix] },
    filter: { id: { regex: "//posts//" } }
  ) {
    edges {
      node {
        excerpt
        html
        fields { 
          slug
          prefix 
        }
        frontmatter {
          title
        }
      }
    }
  }
}
